import React from 'react'

import SectionA from './body/SectionA'
import SectionB from './body/SectionB'

const Product = (props) => {

    return (
        <div>

            {props.products && <SectionA id={props.id} title={props.title} product={props.products} author={props.author} image={props.image} date={props.date} />}
            {props.products && <SectionB id={props.id} title={props.title} author={props.author} image={props.image} description={props.description} features={props.features} product={props.products} />}
        </div>
    )
}

export default Product
